#基于肥羊增强后端支持ipv6,acl去广告规则修改,已知全局mode可能会有问题,只能使用rule
#转换网址https://www.bejson.com/json/json2toml/
[log]
disabled = false
level = "info"
timestamp = true

[dns]
final = "dns_direct"
independent_cache = true

[[dns.servers]]
tag = "dns_proxy"
address = "tls://1.1.1.1"
address_resolver = "dns_resolver"

[[dns.servers]]
tag = "dns_direct"
address = "h3://dns.alidns.com/dns-query"
address_resolver = "dns_resolver"
detour = "直连DIRECT"

[[dns.servers]]
tag = "dns_fakeip"
address = "fakeip"

[[dns.servers]]
tag = "dns_resolver"
address = "223.5.5.5"
detour = "直连DIRECT"

[[dns.servers]]
tag = "block"
address = "rcode://success"

[[dns.rules]]
outbound = ["any"]
server = "dns_resolver"

[[dns.rules]]
geosite = ["category-ads-all"]
server = "dns_block"
disable_cache = true

[[dns.rules]]
geosite = ["geolocation-!cn"]
query_type = ["A", "AAAA"]
server = "dns_fakeip"

[[dns.rules]]
geosite = ["geolocation-!cn"]
server = "dns_proxy"

[dns.fakeip]
enabled = true
inet6_range = "fc00::/18"
inet4_range = "198.18.0.0/15"

[ntp]
enabled = true
server = "time.apple.com"
server_port = 123
interval = "30m"
detour = "直连DIRECT"

[[inbounds]]#socks4, socks4a, socks5 和 http代理
type = "mixed"
tag = "mixed-in"
listen = "0.0.0.0" #怕被偷流量可以换成127.0.0.1
listen_port = 2080
set_system_proxy = false #仅支持 Linux、Android、Windows 和 macOS。启动时自动设置系统代理，停止时自动关闭。(实测安卓14开不了,有root也不行singbox1.8)

[[inbounds.users]] # 代理的密码,不要密码这三行可以直接删了
username = "admin"
password = "admin"


[[inbounds]]
type = "tun"
tag = "tun-in"
inet4_address = "172.19.0.1/30"
inet6_address = "fdfe:dcba:9876::1/126"
auto_route = true
strict_route = true
stack = "mixed"
sniff = true

[[outbounds]]
type = "direct"
tag = "直连DIRECT"

[[outbounds]]
type = "block"
tag = "拒绝REJECT"

[[outbounds]]
type = "dns"
tag = "dns-out"

[[outbounds]]
type = "hysteria2"
tag = "线路3"
server = "打码"
server_port = 443
up_mbps = 30
down_mbps = 100
password = "打码"

[outbounds.tls]
